Buenos días desde #cdmx El sábado pasado tuve el gustazo de fotografiar a la pareja de guapos, elegantes y divertidos amigos Meche 
@mechismoo
y Alex @sanlaralex en el día de su boda. Lo hicieron de lujo delante de cámara y nos reímos muchísimo!!! Sois un encanto. Estaban guapísimos y el vestido de Meche era mega bonito. Estoy deseando que veáis el resultado yaaaaa👏 Espectaculares. Mil gracias @justo_grau por presentármelos estoy feliz. Abrazo fuerte 😀📸

Buenos días. Que estupendo volver a ver a la familia Grimalt 👍👏 Tan encantadores y tan divertidos como siempre! Hicimos un book a la pequeña Lucia, fotos de familia y nos lo pasamos de cine😜 les tengo mucho cariño, sobre todo a Celia y son clientes míos desde hace muchos años  @celiagrimalt
@vickkyotto
